import React, { Component } from "react";
import Card from "../Common/Card";
import { Breadcrumb, Icon, Row, Col, Layout, Carousel, Button, Divider } from "antd";
class Post extends Component {
  render() {
    const { data } = this.props;
    return (
      <Row>
        <Row>
          <Col span={2}></Col>
          <Col span={20}>data</Col>
          <Col span={2}></Col>
        </Row>
        <div className="post-card">
          {data
            ? data.map((item, j) => {
                return <Card title={item.name} img={item.profile} description={item.surname} />;
              })
            : null}
        </div>
      </Row>
    );
  }
}
export default Post;
